import React from "react";

const MainStage = () => {
  return <p>Main Stage</p>;
};

const ProjectStage = () => {
  return <p>Project Stage</p>;
};

const NavBar = ({ stage }) => {
  const isMainStage = stage === "main";
  const isProjectStage = stage === "project";

  return (
    <div>
      {isMainStage && <MainStage />}
      {isProjectStage && <ProjectStage />}
    </div>
  );
};

export default NavBar;
